import React  from "react";

function Table_column_child(props){
    console.log("Table_column_child");
    //let style_p = {display:"none"};
    //let style_p2 = {display:"none"};
    //let style_p3 = {display:"none"};
    //let style_p4 = {display:"none"};
    //let style_s = {display:"none"};
    //let style_s2 = {display:"none"};
    //let style_s3 = {display:"none"};
    //let style_s4 = {display:"none"};
    //if(props.num === props.boy_p.boy1) style_p = {display:"block"}
    //if(props.num === props.boy_p.boy2) style_p2 = {display:"block"}
    //if(props.num === props.boy_p.boy3) style_p3 = {display:"block"}
    //if(props.num === props.boy_p.boy4) style_p4 = {display:"block"}
    //if(props.num === props.boy_s.boy1) style_s = {display:"block"}
    //if(props.num === props.boy_s.boy2) style_s2 = {display:"block"}
    //if(props.num === props.boy_s.boy3) style_s3 = {display:"block"}
    //if(props.num === props.boy_s.boy4) style_s4 = {display:"block"}

    let styleP = ["none","none","none","none"] 
    let styleS = ["none","none","none","none"] 
    const keysP = Object.keys(props.boy_p)
    const keysS = Object.keys(props.boy_s)
    for(let i=0 ; styleP.length ; i++){
        if(props.num === props.boy_p[keysP[0]]) styleP[i] = "block"
        if(props.num === props.boy_s[keysS[0]]) styleS[i] = "block"
    }


    return(
        <div className={`${props.table_column_children} d-flex justify-content-center align-items-center border-dark`}>
            <div style={{position:"absolute"}}> {props.num} </div>
            
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_1")}} style={{display:styleP[0]}}  className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_2")}} style={{display:styleP[1]}} className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_3")}} style={{display:styleP[2]}} className={`rounded-circle border Boy bg-primary`}></div>
            <div onClick={()=>{if(props.p_yakliki)props.calcule("boy_p_4")}} style={{display:styleP[3]}} className={`rounded-circle border Boy bg-primary`}></div>

            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_1")}} style={{display:styleS[0]}}  className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_2")}} style={{display:styleS[1]}} className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_3")}} style={{display:styleS[0]}} className={`rounded-circle border Boy bg-success`}></div>
            <div onClick={()=>{if(props.s_yakliki)props.calcule("boy_s_4")}} style={{display:styleS[0]}} className={`rounded-circle border Boy bg-success`}></div>
        </div>
    )
}

export default React.memo(Table_column_child);
